import React from "react"
import MapView from "react-native-maps"

export default class Mapa extends React.Component {
    render() {
        return (
          <MapView
             style={{ flex: 1 }}
             provider={PROVIDER_GOOGLE}
             showsUserLocation
             initialRegion={{
             latitude: 37.78825,
             longitude: -122.4324,
             latitudeDelta: 0.0922,
             longitudeDelta: 0.0421}}
          />
        );
      }

}
